Negative or uncertain global conditions could prevent us from accurately forecasting demand for our products and services. In addition, a shift in the mix of orders from our customers away from low-cost markets to higher cost markets could adversely affect our operating margins. Our operations in Asia Pacific and EMEA are subject to U.S. regulations governing equipment export. These laws are complex and require us to obtain export licenses, a failure of which could expose us to fines, penalties and export ban. The U.S. Department of Commerce continually updates and often expands the list of entities, to whom U.S. companies cannot sell certain products without a license from the Department of Commerce. These rules and regulatory changes could have material adverse impact on the result of our operations.

The timely development of new or enhanced products and services requires us to:
•design innovative and performance-enhancing features to differentiate our products and services;
•identify emerging technological trends, including new standards for our products and services;
•accurately identify and design new products and services to meet market needs;
•timely and efficiently collaborate with OEMs and IDMs to design and develop products and services;
•timely ramp-up production of new products, especially new subsystems, at acceptable yields and costs;
•successfully manage development production cycles; and
•respond effectively to technological changes or product or service announcements by others.
We must achieve design wins to retain our existing customers and to obtain new customers. New capital equipment typically has a lifespan of several years, and OEMs frequently specify which systems, subsystems, components and instruments are to be incorporated in their equipment. Once incorporated, the OEM will likely maintain that same composition of products for at least several months. IDMs typically establish cleaning, coating, and analytical services as they develop and qualify new chip designs for production. Once a cleaned or coated part has been qualified, the refurbishment processes used to clean or coat the qualified part will likely continue to be used. Accordingly, it is important that our products and services are designed into the new capital equipment and new chip designs (known as a “design win”), to retain our existing customers and to obtain new customers.

