Changes in tax rates or tax assets and liabilities could affect results of operations. As a global company, we are subject to taxation in the United States and various other countries. Significant judgment is required to determine and estimate worldwide tax liabilities. Our annual and quarterly tax rates could be affected by numerous factors, including changes in the applicable tax laws, amount and composition of pre-tax income in countries with different tax rates, and valuation of our deferred tax assets and liabilities. In addition, due to economic and political conditions, tax laws and tax rates for income taxes in various jurisdictions may be subject to significant changes. For example, the Organization for Economic Co-Operation and Development (the “OECD”) continues to advance proposals for modernizing international tax rules, including the introduction of a framework to implement a global minimum corporate tax of 15%, referred to as Pillar Two. While it is uncertain whether the U.S. will enact legislation to adopt Pillar Two, certain countries in which we operate have adopted legislation and other countries are in the process of introducing legislation to implement Pillar Two. It is possible that such measures, if adopted, may adversely affect our provision for income taxes.

